**Describe the bug**
LpNorm leaves some output tensor elements unwritten if the norm is 0 (leaving random values), but it should write every output element, either 0 or NaN. When comparing GPU vs CPU paths, I was getting 0 in the DML GPU but 0xCDCDCDCD for the CPU 🤨, which was from this line:

\onnxruntime\core\providers\cpu\nn\lp_norm.cc
``` c++
void DoNormalizeP1(
    const float* xData,
    float* yData,
    const int64_t m,
    const int64_t n,
    const int64_t sf) {
  for (int i = 0; i < n; ++i) {
    auto base = (i / sf) * sf * m + (i % sf);
    ConstStridedVec xVec(xData + base, 1, m, InnerStride(sf));
    auto norm = xVec.template lpNorm<1>();
>>> if (norm != 0) {
      StridedVec yVec(yData + base, 1, m, InnerStride(sf));
>>>   yVec = xVec / norm;
    }
  }
};
```
Repro:
``` json
    // P = 1. 2D. Axis 0.
    {
      "op_type": "LpNormalization",
      "axis": 0,
      "p": 1,
      "input":  [[1, 0, 3, 2],
                 [0, 0, 0, 2]],
      "output": [[1, 0, 1, 0.5],
                 [0, 0, 0, 0.5]],
      "T": "float32"
    },
```

Expected output:
```
Expected outputs:
    float32 output[2,4]:
        [0]/[0,0]: 1 (0x3F800000)
        [1]/[0,1]: 0 (0x00000000)
        [2]/[0,2]: 1 (0x3F800000)
        [3]/[0,3]: 0.5 (0x3F000000)
        [4]/[1,0]: 0 (0x00000000)
        [5]/[1,1]: 0 (0x00000000)
        [6]/[1,2]: 0 (0x00000000)
        [7]/[1,3]: 0.5 (0x3F000000)
Actual outputs:
    float32 output[2,4]:
        [0]/[0,0]: 1 (0x3F800000)
        [1]/[0,1]: -4.31602e+08 (0xCDCDCDCD) <<<<<<<<<<<<<<<<<<<<
        [2]/[0,2]: 1 (0x3F800000)
        [3]/[0,3]: 0.5 (0x3F000000)
        [4]/[1,0]: 0 (0x00000000)
        [5]/[1,1]: -4.31602e+08 (0xCDCDCDCD) <<<<<<<<<<<<<<<<<<<<
        [6]/[1,2]: 0 (0x00000000)
        [7]/[1,3]: 0.5 (0x3F000000)
```

